class TestDuplicatedFunctions(unittest.TestCase):
    """
    Test functions for which STRNaming contains multiple implementations.
    """

    def test_plain_python(self):
        """
        Test the plain python implementations of detect_repeats
        and find_longest_repeat in libstrnaming.
        """
        for locus, (refseq, matrix_expected, repeat_expected) in LOCUS_DATA.items():
            with self.subTest(locus=locus):
                matrix = libstrnaming.detect_repeats(refseq)
                self.assertEqual(matrix, matrix_expected)
                repeat = libstrnaming.find_longest_repeat(matrix)
                self.assertEqual(repeat, repeat_expected)


    def test_numpy_equivalent(self):
        """
        Test the vectorised numpy implementations of detect_repeats_np
        and find_longest_repeat_np in refseq_analysis.
        """
        for locus, (refseq, matrix_expected, repeat_expected) in LOCUS_DATA.items():
            with self.subTest(locus=locus):
                matrix = refseq_analysis.detect_repeats_np(refseq)
                self.assertEqual(matrix.tolist(), matrix_expected)
                repeat = refseq_analysis.find_longest_repeat_np(matrix)
                self.assertEqual(repeat, repeat_expected)


if __name__ == "__main__":
    unittest.main(catchbreak=True, verbosity=2)
